}

.settings-button {
  position: fixed;
  right: 20px;
  bottom: 20px;
  z-index: 2;
  color: var(--text-secondary-color);
  font-size: 22px;
  font-weight: 590;
  width: 44px;
  height: 44px;
  border-radius: 50%;
  corner-shape: round;
  background-color: var(--search-bg-color);
  box-shadow: 0 1px 4px rgba(0, 0, 0, 0.1);
  border: 0.5px solid var(--search-border-color);
  transition:
    background-color 0.15s ease,
    box-shadow 0.15s ease,
